public Object getSummaryValue(){
  if (maxCount == 1) {
    return null;
  }
  if (multiMaxValue && cacheMap != null && !cacheMap.isEmpty()) {
    for (Iterator i=cacheMap.keySet().iterator(); i.hasNext(); ) {
      Object key=(Object)i.next();
      int count=(Integer)cacheMap.get(key);
      if (count == maxCount) {
        mode=key;
        break;
      }
    }
  }
  cacheMap=null;
  return mode;
}

