  }
 else {
    PropertyDefn propDefn=(PropertyDefn)metaData.getProperty(IDesignElementModel.NAME_PROP);
    if (propDefn == null)     throw new NameException(element,name,NameException.DESIGN_EXCEPTION_NAME_FORBIDDEN);
