currentState=STATE_END;
return;
}
case STATE_MEASURE:
if (!isVerticalMeasure) {
for (int i=measureIndex + 1; i < mCount; i++) {
measureIndex=i;
currentState=STATE_MEASURE;
return;
}
}
 else if (measureIndex == -1 && mCount > 0) {
measureIndex--;
currentState=STATE_MEASURE;
return;
}
currentState=STATE_END;
return;
}
}

