      customed=true;
    }
  }
if (!customed) {
  buildinTg=goFactory.createTrigger(TriggerCondition.ONCLICK_LITERAL,goFactory.createAction(ActionType.TOGGLE_VISIBILITY_LITERAL,goFactory.createSeriesValue(String.valueOf(se.getSeriesIdentifier()))));
