        exp=skh.getExpression();
        if (!expList.contains(exp)) {
          expList.add(exp);
        }
      }
      for (Iterator itr=handle.getParamBindings().iterator(); itr.hasNext(); ) {
        ParamBindingHandle pbh=(ParamBindingHandle)itr.next();
        exp=pbh.getExpression();
        if (!expList.contains(exp)) {
          expList.add(exp);
